import React from 'react';
import Card from '../Components/Card';

const Favs = ({ favoriteDentists, removeFromFavorites }) => {
  return (
    <>
      <h1>Dentistas Favs</h1>
      {favoriteDentists.length > 0 ? (
        <div className="card-grid">
          {favoriteDentists.map((dentist) => (
            <Card
              key={dentist.id}
              dentist={dentist}
              removeFromFavorites={() => removeFromFavorites(dentist.id)} // Pasar la función para eliminar
              isFavorite={true} // Indicar que es favorito
            />
          ))}
        </div>
      ) : (
        <p>No tienes dentistas destacados.</p>
      )}
    </>
  );
};

export default Favs;
